import BarChart from "./BarChart";
import CurrentEvents from "./CurrentEvents";
import { XyzTransition } from "@animxyz/react";
import Footer from "./footer";

function HomePage() {
  return (
    <div className="">
        <Navigation/>
        <Slider/>
        <Flash/>
        <CurrentEvents/>
        <RegionalOfficeSection/>
        <BarChart/>
    </div>
  );
}

export default HomePage;
